import React from 'react';
import ReactDOM from 'react-dom'; // Certifique-se de que esta importação está correta
import App from './App';
import { ThemeProvider } from '@mui/material/styles';
import getTheme from './Theme';

const initialMode = 'light'; // Ou 'dark', dependendo da preferência
const theme = getTheme(initialMode);

ReactDOM.render(
  <ThemeProvider theme={theme}>
    <App />
  </ThemeProvider>,
  document.getElementById('root')
);
